import React from "react";
import Header from "../layouts/Header";

const HomePage = () => {
    return (
        <>
            <Header/>
            <main className="p-8">
                <h1 className="text-3xl mt-4 mb-3">Our Products</h1>
                <div className="w-48 border-[1px] border-gray-300 p-3 rounded-xl shadow-lg">
                    <img src="https://fdn2.gsmarena.com/vv/pics/apple/apple-iphone-15-pro-1.jpg" alt="Iphone 15 Pro" />

                    <div className="font-bold mt-3">Iphone 15 Pro</div>
                    <div>Rp. 12.000.000</div>
                </div>
            </main>
        </>
    )
}

export default HomePage;
